(31149, 375, 0, 1, '解脫', '被索然無味\r\n充滿忙碌的現實生活壓迫後\r\n你是否想好好面對自己 面對自己想做的事\r\n亦或是\r\n想得到生命上的解脫', '2010-12-29 00:00:00', 2000, 0, 2, 14, '喝了一口微酸的啤酒\r\n看著手錶指針慢慢地走\r\nBob Marley 曾經告訴我\r\n面對生活別太多煩憂\r\n\r\n你若是感到苦悶想解脫\r\n請記得別自己獨自一人走\r\n總是問自己何時有結果\r\n看到死神請你告訴我\r\n\r\n就請你跟我說~\r\n就請你讓我走~\r\n就請你跟我做~\r\n就請你埋了我~\r\n\r\n吸入一口陌生的氣息\r\n看著廣場人群不斷地走\r\nJohn Lennon曾經告訴我\r\n追求夢想 別管他們說\r\n\r\n你若是感到苦悶想解脫\r\n請記得別自己獨自一人走\r\n總是問自己何時有結果\r\n看到天使請你告訴我\r\n\r\n就請你跟我說~\r\n就請你讓我走~\r\n就請你跟我做~\r\n就請你埋了我~\r\n\r\n(就請你殺了我)...', '', 258, '', '何米', '何米', '沉默之音', '獨立製作', '', 0, 0, 1, '2010-12-29 19:36:15', '2013-10-07 17:17:43', '0000-00-00 00:00:00'),
(31150, 375, 0, 1, 'Mojo Girl', '有沒有曾經遇到令你怦然心動的Dream Girl\r\n想衝動地跟他在一起呢??', '2010-12-29 00:00:00', 2000, 0, 2, 14, '迷人的雙眼 透露出某種訊息\r\n誘人般的氣息 佔據我的心\r\n眼睛下的世界 卻讓我捉摸不定\r\n天真的笑容 融化我的心\r\n\r\nI have to say Lonely days *2\r\nDon''t come with me\r\n\r\n疲憊的身軀 需要酒精給我麻痺\r\n也許** 能給我更多安慰\r\nMOjo 的感覺 就像是失戀無助體會\r\n不要懷疑 就是唱給妳聽\r\n\r\nI have to say Lonely days *2\r\nDon''t come with me\r\n', '', 250, '', '何米', '何米', '沉默之音', '獨立製作', '', 0, 0, 1, '2010-12-29 19:39:49', '2013-10-07 17:17:43', '0000-00-00 00:00:00'),
(31151, 10054, 0, 1, 'In back of the dark cloud', '陰天時，太陽並沒有消失，只是被烏雲擋住了，終究還是有雨過天晴的時候。\r\n悲傷時，快樂的事物只是被你心中的不愉快遮住了。', '2010-12-30 00:00:00', 2000, 25, 0, 7, '呼吸著今天的空氣　學著忘記過去\r\n我告訴你明天還有美麗　你會不會相信？\r\n\r\nCan you see the sun in back of the dark clouds.\r\n正在醞釀微笑\r\nYou should keep smile.　和一些勇敢\r\nTears had already dry....and you don''t need pain\r\n\r\n你說過去的傷太痛　讓你忘了笑容\r\n我說是你不願往前走　才將自己上鎖\r\n\r\nCan you see the sun in back of the dark clouds.\r\n正在醞釀微笑\r\nYou should keep smile.　和一些勇敢\r\nTears had already dry....and you don''t need pain\r\n\r\n劃破表皮　流光血液　放棄生命　放棄回憶\r\n留下遺憾　留下空虛　流下淚滴　為你痛心\r\n我還在這裡　希望你相信　黑夜後一定有黎明\r\n\r\nCan you see the sun in back of dark clouds.\r\n正在醞釀微笑\r\nYou should keep smile.　和一些勇敢.......\r\n\r\n', '', 323, '', 'Face Yesterday', 'sao', '', 'Indie', '', 0, 1, 0, '2010-12-29 20:50:50', '2015-03-12 13:45:16', '0000-00-00 00:00:00'),
