(31154, 9979, 0, 1, '來自異星(From Mars)', '關於外星人與地球的感情生活.', '2010-12-30 00:00:00', 2000, 0, 2, 7, '它來自異星,它沒有言語\r\n\r\n卻能知道人們內心的脆弱\r\n\r\n它來自異星,它沒有表情\r\n\r\n卻能看穿面具下的苦痛\r\n\r\n=========================\r\n\r\nBack to Mars \r\n\r\nLeaving the Earth\r\n\r\nI will miss the gentle persons\r\n\r\nbeautiful view\r\n\r\nWarm hearts \r\n\r\nI will miss everyone.\r\n\r\n', '', 397, '', '易修', '易修', '無', '無', '', 0, 0, 1, '2010-12-30 03:58:45', '2013-10-07 17:17:43', '0000-00-00 00:00:00'),
