(31203, 32959, 3077, 1, '微光', '', '2010-12-18 00:00:00', 2010, 25, 0, 7, '\r\n俯瞰水中的自己\r\n懷疑是否仍獨特而透明\r\n跨越了那一片擁擠\r\n我正試著讓自己清醒\r\n\r\n我想我是刻意迴避\r\n那些用惡意去餵養的曾經\r\n如果先選擇了放棄\r\n是不是就不用害怕失去\r\n\r\n路途上所有的風景\r\n不一定都存在什麼意義\r\n我們別過分的關心\r\n沒有什麼不能稱之為美麗\r\n\r\n\r\n當你說你願意陪著我流浪\r\n我看見了你眼中的微光\r\n世界上也許沒有任何地方\r\n擲棄我們的憂傷\r\n\r\n黑暗中我們交換彼此的傷\r\n我眷戀於你眼中的微光\r\n在感覺一切失去之前，你說\r\n我們都別再徬徨\r\n\r\n\r\n任慾望在我們面前，鋪張\r\n任寂寞在我們心中，消長\r\n', '', 214, '', '柯家洋', '柯家洋', '南瓜妮歌迷俱樂部', '', '', 0, 1, 0, '2010-12-30 15:50:36', '2015-03-12 13:45:18', '0000-00-00 00:00:00'),
(31204, 32959, 3077, 2, '森林男孩', '', '2010-12-18 00:00:00', 2010, 25, 0, 7, '\r\nHey, little boy\r\n你是否仍覺得孤單\r\n找個地方埋葬\r\n那些想說的話\r\n\r\nHey, little child\r\n你是否害怕天亮\r\n當寂寞的影子\r\n漸漸被拉長\r\n\r\n\r\n於是你在黑暗中漫舞\r\n儘管漆黑卻不在乎\r\n空氣中流動著\r\n只有你懂得孤獨\r\n\r\n終究你不再追逐\r\n心中無以名狀的驕傲\r\n消失的便消失了\r\n像你所期盼的流星般墜落\r\n\r\n\r\n仔細聆聽每個經過\r\n如此渺小而不負重量\r\n不要迷失在故事之中\r\n不要迷失在故事中\r\nSo come out\r\nSo come out\r\nSo come out\r\nSo come out\r\n', '', 314, '', '柯家洋', '柯家洋', '南瓜妮歌迷俱樂部', '', '', 0, 1, 0, '2010-12-30 15:52:26', '2015-03-12 13:45:18', '0000-00-00 00:00:00'),
(31205, 91495, 0, 2, '光榮血統', '', '2010-10-30 00:00:00', 2000, 0, 2, 7, '我曾經失敗 我曾經迷惘\r\n我曾失去愛 我剩下傷害\r\n你從沒離開 你總是等待\r\n你提供溫暖 你給我未來\r\n\r\n我的血液 有你光榮血統\r\n我的靈魂 有聖潔和尊榮\r\n沒有人能 奪走我的笑容\r\n因為我有光榮的血統 ', '', 305, '', '松慕強', '松慕強', '松慕強', '', '', 0, 0, 1, '2010-12-30 16:16:45', '2013-10-07 17:17:44', '2013-03-19 14:07:10'),
