(31210, 91495, 0, 3, '台灣加油', '', '2010-10-30 00:00:00', 2000, 0, 2, 7, '曾經受傷過　我知道你痛\r\n想告訴你 我會在你的左右\r\n用心守護你　用愛陪伴你\r\n直到你重新恢復美麗 \r\n永遠別放棄　希望和奇蹟\r\n生命值得你再繼續走下去\r\n希望的眼光　會帶出力量\r\n黑夜後黎明就會來臨 \r\n\r\n加油 台灣加油\r\n請相信我們從來不曾離開過\r\n加油 台灣加油\r\n風雨中我們會牽手走過', '', 242, '', '松慕強', '松慕強', '松慕強', '', '', 0, 0, 1, '2010-12-30 16:21:14', '2013-10-07 17:17:44', '2013-03-19 14:07:16'),
