(31212, 91495, 0, 3, '勇氣', '', '2010-10-30 00:00:00', 2000, 0, 2, 7, '挪亞在洪水之前大聲疾呼\r\n摩西在紅海之前伸出手杖\r\n大衛在巨人之前甩出機旋\r\n他們心中有同樣的感受\r\n他們心中有同樣的感受\r\n\r\n在我裡面的 比世界更大 \r\n我已經擁有 大權柄\r\n可以踐踏蛇和蠍\r\n \r\n神啊賜下屬天的勇氣\r\n讓我勇敢執行祢旨意\r\n神啊賜下屬天的勇氣\r\n讓我活出祢生命 ', '', 282, '', '松慕強', '松慕強', '松慕強', '', '', 0, 0, 1, '2010-12-30 16:22:23', '2013-10-07 17:17:44', '0000-00-00 00:00:00'),
(31213, 91495, 0, 1, '在你愛中', '', '2010-10-30 00:00:00', 2000, 0, 2, 12, '你的愛像溫暖空氣 \r\n在寒冷的夜安慰我的孤寂 \r\n你的愛像清涼小溪 \r\n在酷熱日子滋潤我的內心\r\n\r\n任何事 不能換取你的愛 \r\n全世界的價值都無法取代\r\n任何事 無法改變你的愛 \r\n就算天會荒 就算地會老 \r\n你愛永遠在\r\n\r\n\r\n在你愛中　我無所懼\r\n在你愛中　我充滿勇氣\r\n在你愛中　我無所懼\r\n在你愛中　我必定重新得力 ', '', 322, '', '松慕強', '松慕強', '松慕強', '', '', 0, 0, 1, '2010-12-30 17:07:43', '2013-10-07 17:17:44', '2013-03-19 14:07:19'),
