(31216, 4477, 0, 1, '瞬間', '敘述平凡生活中偶而出現的屬於自己的舞台。', '2011-01-01 00:00:00', 2000, 0, 1, 7, '一樣的生活一樣的你一樣的我相同\r\n\r\n睜開了雙眼  天亮了\r\n那扇忘了關的窗曬進了陽光\r\n下起雨了  風吹著\r\n等待著那一班遲來的車\r\n一樣的生活一樣的你一樣的我相同\r\n只有平凡的孤單的你孤單的我相遇\r\n\r\n啦   \r\n匆匆忙忙的來去這條街道\r\n啦   \r\n輕輕唱著這旋律沒什麼理由\r\n一樣的生活一樣的你一樣的我相同\r\n只有平凡的孤單的你孤單的我相遇\r\n\r\n閉上雙眼的瞬間  這世界開始停止了轉動\r\n我就要拋開所有寂寞\r\n就在這一瞬間我開始看見希望\r\n就在這一瞬間我就要失去方向\r\n\r\n\r\n就在這一瞬間我開始看見希望\r\n就在這一瞬間我就要張開翅膀\r\n就在這一瞬間我開始看見希望\r\n就在這一瞬間我又回到這地方\r\n\r\n睜開了雙眼  天亮了\r\n那扇忘了關的窗曬進了陽光\r\n下起雨了  風吹著\r\n等待著那一班遲來的車\r\n一樣的生活一樣的你一樣的我\r\n那平凡的孤單的你孤單的我\r\n都等待著那一瞬間的悸動\r\n而就在這瞬間又回到寂寞', '', 289, '', 'Soundboss', '恰吉', 'Soundboss', 'Soundboss', '', 1, 1, 1, '2010-12-30 22:20:18', '2014-01-01 13:19:22', '2014-01-01 13:19:22'),
(31217, 63404, 0, 1, '愛上你的衝動(DEMO)', '', '2010-12-30 00:00:00', 2000, 0, 1, 2, '愛上你的衝動\r\n\r\n詞曲:Pan.s.w(潘信維) 副歌詞:陳零九 副歌(女):Albee Lan 編曲:pan.s.w\r\n\r\n\r\n舞池裡燈 光帶著 微醺感   你的氣息 芬芳在我心打轉\r\n\r\n你的笑容 像是寒冬 燃起 的木材  讓人想猜 讓人大膽 的為你示愛\r\n\r\n包誇 我     也奮不顧身 為你瘋  瘋了的我 砸多少錢都不算多\r\n\r\n只要可以換取 你的微笑 就足夠  \r\n\r\nGO GO GO MAN 她的目光好像看像這邊 \r\n\r\n是否可能注意到 我們瘋狂的行徑\r\n\r\n在他周圍 築起了 堡壘 監視 周圍的 環境\r\n\r\n我 已經準備起身 走向你  \r\n\r\n我 再也沒有辦法 克制自己  \r\n\r\n我 只好任由愛神 來攻擊\r\n\r\n我 \r\n\r\n\r\n你的眼神 像電流放映\r\n\r\n曖昧 流動 的Martini\r\n\r\n時間 停在這裡   彷彿 世界 就 我 和 你\r\n\r\n蠢蠢欲動 壓抑情緒\r\n\r\n不能 這樣 跟你 回去\r\n\r\n再給 多一點  多一些 \r\n\r\n愛上你的 理由\r\n\r\n和衝動', '', 226, '', '潘信維', '潘信維.陳零九', '潘信維', '', '', 0, 1, 0, '2010-12-30 23:11:12', '2015-03-12 13:45:18', '0000-00-00 00:00:00'),
