(31290, 91488, 3075, 5, '米奇與米妮', '', '2010-12-31 00:00:00', 2000, 20, 0, 7, '', '作詞：姚國禎\n作曲：姚國禎\n\n很久很久以前\n有兩隻老鼠生來就相戀\n那年的起司片\n至今回味都還特別甜\n身上的蝴蝶結\n一繫就是好幾個春天（夏天，秋天，冬天）\n黑白到彩色世界\n幸福燦爛沒有期限\n\n很久很久以前\n我每天讀這個童話入眠\n總相信我也會\n遇見有feel的人一起睡\n緊緊相依又相偎\n抱著迎接日光與黑夜\n蛋糕配杯熱咖啡\n即使窩在一個幾坪大的小房間\n\n場景已就緒\n道具也買齊\n對白都寫好\n整齣對手戲就只差了你\n\n喔我的米奇！喔我的米妮！親愛的你到底在哪裡\n喔我的米奇！喔我的米妮！親愛的你到底在哪裡\n喔我的米奇！喔我的米妮！親愛的你到底在哪裡\n\n我還在這裡\n就站在這裡\n買好了票\n等你\n\n去迪士尼\n', 300, '', '', '', '', '', '', 0, 1, 0, '2011-01-04 12:54:42', '2015-03-12 13:45:20', '0000-00-00 00:00:00'),
(31291, 91488, 3075, 6, '香蕉先生', '', '2010-12-31 00:00:00', 2000, 20, 0, 7, '', '蘋果 芭樂 西瓜與瓢蟲\n唯獨 你 能使我歡樂\n便祕 擁腫 或身體虛弱\n有你 就有 健康的生活\n\n草莓 香草 牛奶與可可\n唯獨 你 怎樣都不噁\n蛋糕 冰棒 清涼飲料包\n有你 就能 讓我掏錢要\n\n大不了作成果汁時\n常常我會選擇奇異果\n但是請你記得\nOh pleeeeeeeeeeeease remember\n\n香蕉先生 你是我的好朋友\n香蕉先生 你是我的好朋友\n香蕉先生 你是我的好朋友\nyou are not only a friend but also my doctor\n\n香蕉先生 你是我的好朋友\n香蕉先生 你是我的好朋友\n香蕉先生 你是我的好朋友\n愛你 love you 因為你死所以我能活', 196, '', '', '', '', '', '', 0, 1, 0, '2011-01-04 12:55:25', '2015-03-12 13:45:20', '0000-00-00 00:00:00'),
