(31296, 91823, 3081, 1, '想不到', '', '2010-12-31 00:00:00', 2010, 19, 0, 5, '', '白天的月亮和晚上的太陽\n遙遠的夢想和流動的時光\n她們有甚麼不一樣\n迷人的風景不迷人的旅行\n自由的生命不自由的身體\n她們有甚麼好追尋\n喔　你\n碰不到　抓不到　手裡的美好\n為什麼你　躲不掉　甩不掉　你所有的打擾\n可惜你　看不到　聽不到　猜不到　做不到　只因為你煩惱\n無所謂　好不好　是不是　對不對　要不要　只因為你　還　想不到\n喔　你\n碰不到　抓不到　手裡的美好\n為什麼你　躲不掉　甩不掉　你所有的打擾\n可惜你　看不到　聽不到　猜不到　做不到　只因為你煩惱\n無所謂　好不好　是不是　對不對　要不要　只因為你　還　想不到\n', 264, '', '', '', '', '', 'TWV271001601', 1, 1, 0, '2011-01-04 16:30:34', '2015-03-12 13:45:20', '0000-00-00 00:00:00'),
(31297, 91823, 3081, 2, '瑣碎的小事', '', '2010-12-31 00:00:00', 2010, 19, 0, 5, '', '世界角落建了座城市給你\n陽光下一定都會有塵埃\n拍拍就不在\n世界盡頭建了座花園給你\n我們可以一起做些小事情\n一起談天氣\n一起玩遊戲\nWe laugh we cry we kiss we fight\nWe laugh we cry we kiss we fight\n\n灰色字句 針一樣刺進了耳朵\n我依然低頭微笑 我知道\n你不想這樣說\n看著你眼裡在搖曳的火焰\n唱首情歌輕易就將它熄滅\n然後靠在你身邊\n輕聲把你粉碎\n\nGood night good night\nA kiss night\nGood night good night\n就這樣不要醒過來\n睡夢裡多愉快\nGood night good night\nI''ll sing you a lullaby\nLeave those bad words behind\n\nI spread my dream under your feet\nHide the shadow in between the trees\nNo matter life is fake or true\nYou know I''ll always stay with you', 241, '', '', '', '', '', 'TWV271001602', 1, 1, 0, '2011-01-04 16:31:00', '2015-03-12 13:45:20', '0000-00-00 00:00:00');
